description:
The Class 90 for Train Simulator is available in two liveries, blue/white striped and grey/white. Features of the locomotive include advanced and HUD versions, accurate performance physics, prototypical braking system, cold start option, independent guard and driver wipers, LED headlights, a MK3 coach consist and driveable Class 82 Mk3 DVT. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the Greater Anglia Class 90 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Great Eastern Main Line London-Ipswich route (available separately and required to play these scenarios).


Please support the developers and buy some of their content if you can afford it.


